import React from 'react'
import Karavanlar1 from './Components/Karavanlar1';
import Karavanlar2 from './Components/Karavanlar2';
import { karavanlar } from './karavandata';
import Zoom from 'react-reveal/Zoom';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';

function App() {
  return (
    <div className='w-[100%]'>

      <ParallaxBanner
        layers={[
          { image: karavanlar[1], speed: -100 },
          {
            speed: -100,
            children: (
              <div className="position-absolute inset-0 d-flex align-items-center justify-content-center">
                <h1 className="text-white">Hello World!</h1>
              </div>
            ),
          },
          { image: karavanlar[1], speed: -10 },
        ]}
        className="ratio ratio-16x9"
      />

      <div className='w-100 bg-white'>
        {karavanlar.map(karavan => {
          return <Karavanlar1 karavanImage={karavan} />
        })}
      </div>
    </div>
  );
}

export default App;
